    from stations located along coastal waters of Hawaii, North Slope Alaska, Puerto
    Rico/Virgin Islands, eastern US/Gulf of Mexico and western US during August 2016
    (NCEI Accession 0156626)",nt"tracking_summary": {ntt"total": 1,ntt"recent":
